import React from 'react'

function Pages() {
    return (
        <div className='d-flex'>
            {
                Array(1, 2, "..", 9, 10)
                    .map(elem =>
                        <div className='card'>{elem}</div>
                    )
            }
        </div>
    )
}

export default Pages
